            (80, 7, 2, '小さなころから周囲に対して敏感で、周りに合わせてバランスを取ろうとするため、自分を出すのを控える傾向があったのではないでしょうか。\r\nそれはあなたの優しさですが、自分を見失いやすくもなります。いつも周囲を気にしているため、とても気が利きます。どんな人とでも分け隔てなく接することができ、あまり人見知りもないため、接客業などにとても向いています。天性の社交性とバランス感覚があり、美しいものが好きです。しかし、自分が美しく着飾るとか、バランスよく何かを作る、といったアウトプットができるわけではありません。自分をうまく出せず、他者の評価を気にしやすいところもあります。また、パートナーシップに悩みや課題を持つ人も多いのが特徴です。人とのバランス感覚や美意識が高すぎるため、「そうありたい自分」と「現在の自分」の落差を感じて自分に自信が持てない人も多いようです。もともとは行動力のある人なので、持ち前の社交性とバランス感覚で上手に世渡りしていくことができます。そのためには、まず自分を大切にする、ということを学ばなければなりません。', 'Zodiac content of the 7 zodiac by planet 2', 0, NULL, '2023-09-18 08:45:39', '2024-06-13 09:56:54', 'Solar content of the 7 zodiac by planet 2', 'Solar content of the 7 zodiac by planet 2'),
