            (93, 8, 2, '私生活ではあまり広く人と関わらない傾向があります。その代わり、家族や恋人、母親や配偶者など、特定の人との関係をとても大切にします。他の天体の星座にもよりますが、基本的には多くの人と接するよりも特定の人と深く関わろうとします。自分の本心を打ち明けたり、心から信頼できる人は少数でしょう。その代わり、本当に心を許し、愛する人のことは、生涯大切にしようとします。しかし、その想いが空回りしてしまったり、愛が重すぎると思われることもありそうです。他者の気持ちに引きずられ過ぎてしまうため、客観視できずに相手の気持ちや相手にとって何が本当にいいのかを見誤ることもあります。人の心、世の中の真理などを深く探求したい気持ちが強い人ですが、オカルトや神秘、霊的なことに没頭しすぎて妄信することもあるかもしれません。大変集中力がありますが、過集中にもなりやすく、マルチタスクは難しいタイプです。いつも何かをずっと深く考えているようなところがあります。上手に人に頼ったり、人の好意を受け取ることができるようになるといいでしょう。', 'Zodiac content of the 8 zodiac by planet 2', 0, NULL, '2023-09-18 08:45:39', '2024-06-13 09:56:54', 'Solar content of the 8 zodiac by planet 2', 'Solar content of the 8 zodiac by planet 2'),
