            (132, 11, 2, '自由を好み、集団に縛られたくないので、小さな頃からどこかマイペースな雰囲気があったかもしれません。社会や世の中のしがらみにとらわれず、自分の価値観で生きようとします。どこか天才的でもあり、変わりものでもあり、興味のあることを飲み込むのが早いでしょう。広く浅くコミュニケーションすることを好むため、誰とでも分け隔てなく関わろうとします。視野が広く何かを心酔することはほとんどなく、論理的に物事を考えます。技術を吸収し扱うのが得意な傾向があり、情報通信関係や新技術に関わるなど、新しいものを世の中に取り入れて変えていく立場のことをする人が多くなります。しかし、思ったよりも自分は面白いことができない、独創性がない、という壁に突き当たる人もいるかもしれません。集団に迎合せずに未来志向で生きていたいと思うものの、うまく個性を見出せない、自分にしかできないことをみつけることができない、革新性をもつことができない、といった葛藤を抱える人もいます。', 'Zodiac content of the 11 zodiac by planet 2', 0, NULL, '2023-09-18 08:45:39', '2024-06-13 09:56:54', 'Solar content of the 11 zodiac by planet 2', 'Solar content of the 11 zodiac by planet 2'),
